import React from 'react'

const Student=(props) =>{
  const deleteHandler =()=>{
    //删除学生
    fetch('http://localhost:1337/api/students/${props.stuid}')
  }
    //const {stu:{name,age,gender,address}}props
  return (
    <tr>
        <td>{props.stu.attributes.name}</td>
        <td>{props.stu.attributes.gender}</td>
        <td>{props.stu.attributes.age}</td>
        <td>{props.stu.attributes.address}</td>
        <td><button onClick={deleteHandler}>删除</button></td>
    </tr>
  )
}
export default Student
